export function Footer() {
    return (
        <footer>
            <ul class="footer">
                <li class="footer"><a href="https://quiltsbyginny.com/index.html">Home</a></li>
            </ul>

            <p class="center-text" style="color:white; padding-bottom:20px;">
                &copy;<em id="date"></em>2023 by Virginia Frazier
            </p>
        </footer>  
    )
}
